import React from "react";
import Categories from "../Categories";
import styled from "styled-components";

export default function Footer() {
  return (
    <React.Fragment>
      <FooterContainer>
        {" "}
        <Categories />
      </FooterContainer>
    </React.Fragment>
  );
}

const FooterContainer = styled.footer`
  background: black;
`;
